configure:
  commands:
    end:
      new_state: execute
    interface range vlan 11-20: "interface range vlan 11-20\r\n"
    line console 0:
      new_state: configure_line
    no ipv6 traffic-filter ipv6_md_acl in: "no ipv6 traffic-filter ipv6_md_acl in\r\
      \n"
    no logging console: ''
  prompt: A1(config)#
configure_line:
  commands:
    end:
      new_state: execute
    exec-timeout 0: ''
  prompt: A1(config-line)#
connect:
  commands:
    ? ''
    : new_state: execute
  preface: 'Trying mock_device ...

    Connected to mock_device.

    Escape character is ''^]''.'
  prompt: ''
execute:
  commands:
    config term:
      new_state: configure
    config-transaction:
      new_state: configure
    show version: ''
    term length 0: ''
    term width 0: ''
  prompt: A1#
